package com.web.erp.vo;

import java.util.List;

public class HeadOfficeProduct {
	private int product_num;
	private String brand;
	private String item_name;
	private int properties_num[];
	private int cost;
	private String reg_date;
	private int properties_nums;
	private int item_num;
	private int product_count;
	private int product_nums[];
	private int counts[];

	public HeadOfficeProduct() {
		super();
		// TODO Auto-generated constructor stub
	}

	public HeadOfficeProduct(int product_num, String brand, String item_name, int[] properties_num, int cost,
			String reg_date, int properties_nums, int item_num, int product_count, int[] product_nums, int[] counts) {
		super();
		this.product_num = product_num;
		this.brand = brand;
		this.item_name = item_name;
		this.properties_num = properties_num;
		this.cost = cost;
		this.reg_date = reg_date;
		this.properties_nums = properties_nums;
		this.item_num = item_num;
		this.product_count = product_count;
		this.product_nums = product_nums;
		this.counts = counts;
	}

	public int getProduct_num() {
		return product_num;
	}

	public void setProduct_num(int product_num) {
		this.product_num = product_num;
	}

	public String getBrand() {
		return brand;
	}

	public void setBrand(String brand) {
		this.brand = brand;
	}

	public String getItem_name() {
		return item_name;
	}

	public void setItem_name(String item_name) {
		this.item_name = item_name;
	}

	public int[] getProperties_num() {
		return properties_num;
	}

	public void setProperties_num(int[] properties_num) {
		this.properties_num = properties_num;
	}

	public int getCost() {
		return cost;
	}

	public void setCost(int cost) {
		this.cost = cost;
	}

	public String getReg_date() {
		return reg_date;
	}

	public void setReg_date(String reg_date) {
		this.reg_date = reg_date;
	}

	public int getProperties_nums() {
		return properties_nums;
	}

	public void setProperties_nums(int properties_nums) {
		this.properties_nums = properties_nums;
	}

	public int getItem_num() {
		return item_num;
	}

	public void setItem_num(int item_num) {
		this.item_num = item_num;
	}

	public int getProduct_count() {
		return product_count;
	}

	public void setProduct_count(int product_count) {
		this.product_count = product_count;
	}

	public int[] getProduct_nums() {
		return product_nums;
	}

	public void setProduct_nums(int[] product_nums) {
		this.product_nums = product_nums;
	}

	public int[] getCounts() {
		return counts;
	}

	public void setCounts(int[] counts) {
		this.counts = counts;
	}

}